[PixAndVideo] Katy Rose (Tourist In Trouble / 200419 / 06.05.2014)

Katy, the lovely tourist is lost. She is in a foreign city, she doesn't know where she is and even her the battery of her phone is dead. Luckily for her she meets with a kind guy, Toby, who offers his help. He escorts the girl to his home to provide a phone... and while they are waiting, some other entertainment too.


